import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import { useState, useEffect } from "react";
import MyAccordin from "./MyAccordin";
import Footer from "./Footer";
import Navbar from "react-bootstrap/Navbar";
import Silv from "./SilvProject";
import { BrowserRouter, Switch, Route, Link, Routes } from "react-router-dom";
function ColorSchemesExample() {
  const [activeLink, setActiveLink] = useState("home");
  return (
    <>
      <BrowserRouter>
        <Navbar sticky="top" className="myBlackDarkBg myTextWhite shadow">
          <Container>
            <Navbar.Brand href="#home" className="fs-1 fw-bolder myTextWhite">
              <h1>Leonardo Antonelli </h1>
            </Navbar.Brand>
            <Nav className="me-auto fs-4  ">
              <Nav.Link to="/skills" href="#home" className="  myTextWhite ">
                <h5 className=".pheader  myTextWhite"> Skills</h5>
              </Nav.Link>
              <Nav.Link href="/projects">
                <h5 className=".pheader  myTextWhite">Projects</h5>
              </Nav.Link>
              <Nav.Link href="#pricing">
                {" "}
                <h5 className=".pheader  myTextWhite">Contact</h5>
              </Nav.Link>
            </Nav>
          </Container>
        </Navbar>

        <Routes>
          <Route path="/skills" element={<MyAccordin />} />
          <Route path="/contatti" element={<Footer />} />
          <Route path="/projects" element={<Footer />} />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default ColorSchemesExample;
